import React from 'react';
import { Database, Code2, Globe, Server, Cloud, Zap } from 'lucide-react';

const Skills: React.FC = () => {
  const skillCategories = [
    {
      icon: <Code2 className="w-8 h-8" />,
      title: "Backend Development",
      color: "from-blue-500 to-blue-600",
      skills: [
        { name: "Java", level: 95 },
        { name: "Spring Boot", level: 90 },
        { name: "JDBC", level: 88 },
        { name: "REST APIs", level: 85 },
        { name: "Maven/Gradle", level: 80 }
      ]
    },
    {
      icon: <Globe className="w-8 h-8" />,
      title: "Frontend Development",
      color: "from-green-500 to-green-600",
      skills: [
        { name: "React.js", level: 85 },
        { name: "TypeScript", level: 80 },
        { name: "JavaScript", level: 88 },
        { name: "HTML/CSS", level: 90 },
        { name: "Tailwind CSS", level: 75 }
      ]
    },
    {
      icon: <Database className="w-8 h-8" />,
      title: "Databases & Cloud",
      color: "from-purple-500 to-purple-600",
      skills: [
        { name: "MongoDB", level: 82 },
        { name: "Supabase", level: 78 },
        { name: "Firebase", level: 75 },
        { name: "MySQL", level: 80 },
        { name: "PostgreSQL", level: 70 }
      ]
    },
    {
      icon: <Server className="w-8 h-8" />,
      title: "DevOps & Tools",
      color: "from-orange-500 to-orange-600",
      skills: [
        { name: "Git", level: 85 },
        { name: "Docker", level: 70 },
        { name: "Postman", level: 88 },
        { name: "VS Code", level: 90 },
        { name: "IntelliJ IDEA", level: 85 }
      ]
    }
  ];

  const additionalSkills = [
    "Microservices Architecture", "JUnit Testing", "Swagger/OpenAPI", 
    "JWT Authentication", "OAuth2", "GraphQL", "WebSocket", "Redis",
    "AWS Basics", "CI/CD Pipelines", "Agile/Scrum", "Problem Solving"
  ];

  return (
    <section id="skills" className="section-padding bg-white">
      <div className="container-max">
        <div className="text-center mb-16">
          <h2 className="text-3xl sm:text-4xl font-bold text-secondary-900 mb-4">
            Skills & Expertise
          </h2>
          <p className="text-lg text-secondary-600 max-w-2xl mx-auto">
            A comprehensive overview of my technical skills and proficiency levels
          </p>
        </div>

        {/* Skill Categories */}
        <div className="grid md:grid-cols-2 gap-8 mb-16">
          {skillCategories.map((category, index) => (
            <div key={index} className="bg-white rounded-xl shadow-lg p-6 border border-secondary-100">
              <div className="flex items-center mb-6">
                <div className={`p-3 bg-gradient-to-r ${category.color} rounded-lg text-white mr-4`}>
                  {category.icon}
                </div>
                <h3 className="text-xl font-semibold text-secondary-900">
                  {category.title}
                </h3>
              </div>

              <div className="space-y-4">
                {category.skills.map((skill, skillIndex) => (
                  <div key={skillIndex}>
                    <div className="flex justify-between items-center mb-2">
                      <span className="text-sm font-medium text-secondary-700">
                        {skill.name}
                      </span>
                      <span className="text-sm text-secondary-500">
                        {skill.level}%
                      </span>
                    </div>
                    <div className="w-full bg-secondary-200 rounded-full h-2">
                      <div
                        className={`bg-gradient-to-r ${category.color} h-2 rounded-full transition-all duration-1000 ease-out`}
                        style={{ width: `${skill.level}%` }}
                      ></div>
                    </div>
                  </div>
                ))}
              </div>
            </div>
          ))}
        </div>

        {/* Additional Skills */}
        <div className="bg-gradient-to-r from-primary-50 to-purple-50 rounded-2xl p-8 lg:p-12">
          <div className="text-center mb-8">
            <div className="inline-flex items-center justify-center w-16 h-16 bg-primary-100 rounded-full mb-4">
              <Zap className="w-8 h-8 text-primary-600" />
            </div>
            <h3 className="text-2xl font-semibold text-secondary-900 mb-2">
              Additional Skills & Knowledge
            </h3>
            <p className="text-secondary-600">
              Beyond the core technologies, I'm also familiar with these concepts and tools
            </p>
          </div>

          <div className="grid grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
            {additionalSkills.map((skill, index) => (
              <div
                key={index}
                className="bg-white/70 backdrop-blur-sm rounded-lg px-4 py-3 text-center border border-white/50 hover:bg-white hover:shadow-md transition-all duration-300"
              >
                <span className="text-sm font-medium text-secondary-700">
                  {skill}
                </span>
              </div>
            ))}
          </div>
        </div>

        {/* Learning Journey */}
        <div className="mt-16 text-center">
          <h3 className="text-2xl font-semibold text-secondary-900 mb-4">
            Always Learning & Growing
          </h3>
          <p className="text-lg text-secondary-600 max-w-3xl mx-auto">
            I'm constantly expanding my skillset and exploring new technologies. Currently, I'm diving deeper into 
            cloud architecture, microservices, and advanced frontend patterns to build even better applications.
          </p>
        </div>
      </div>
    </section>
  );
};

export default Skills;
